import React, {useState} from "react";
import Sidebar from "../../components/Sidebar";
import Header from "../../components/Header";
import Pagination from "../../components/Pagination";
import {PencilAltIcon, XCircleIcon} from "@heroicons/react/solid";
import SearchBar from "../../components/AdminCustomersSearchBar";

export default function AdminSessions() {
    const movies = [
        { id: 1, time: "11.45",    movie: "Spiderman", hall: "2" },
        { id: 1, time: "13.45",    movie: "Spiderman", hall: "3" },
        { id: 1, time: "15.45",    movie: "Spiderman", hall: "4" },
    ];
    const itemsPerPage = 6
    const pageCount    = Math.ceil(movies.length / itemsPerPage)
    const [currentPage, setCurrentPage] = useState(1)

    return (
        <div className="h-screen flex font-[Poppins]">
            <Sidebar />

            <div className="flex-1 flex flex-col">
                <Header title="Sessions" />

                <main className="inner-container flex-1 p-10 bg-[#D9D9D9]">
                    <div className="bg-white w-full h-full mx-3 my-4 rounded-xl p-6 overflow-auto">
                        <SearchBar />


                        <div className="grid grid-cols-5 gap-4 border-b border-gray-300 pb-2 font-semibold">
                            <div>Session ID</div>
                            <div>Session Time</div>
                            <div>Movie</div>
                            <div>Hall</div>
                            <div></div>
                        </div>

                        <div className="grid grid-cols-5 gap-4 mt-4">
                            {movies.map((m) => (
                                <React.Fragment key={m.id}>
                                    <div className="py-2">{m.id}</div>
                                    <div className="py-2">{m.time}</div>
                                    <div className="py-2">{m.movie}</div>
                                    <div className="py-2">{m.hall}</div>
                                    <div><button><PencilAltIcon className="w-5 h-5"></PencilAltIcon></button>
                                        <button><XCircleIcon className="mr-5 w-5 h-5"></XCircleIcon></button>
                                    </div>
                                </React.Fragment>

                            ))}
                        </div>
                        <div className="mt-auto">
                            <Pagination
                                currentPage={currentPage}
                                pageCount={pageCount}
                                onPageChange={setCurrentPage}
                            />
                        </div>
                    </div>
                </main>
            </div>
        </div>
    );
}
